import React from "react";
import Note from "../components/Note";
import Input from "../components/Input";

const NotesPage = () => {
  return (
    <div className="notespage">
      <Note />
      <p>Create a new note</p>
      <form className="newNote-form">
        <Input title="title" />
        <Input />
        <Input />
        <Input />
      </form>
    </div>
  );
};

export default NotesPage;
